import React from "react";
import {Link} from "react-router-dom";
import {useSelector, useDispatch} from "react-redux";

import {
    Button,
    Nav,
    Navbar,
    NavbarBrand,
    NavItem, NavLink
} from "reactstrap";
import PropTypes from "prop-types";
import {loginAction, logoutAction} from "../ducks/app/actions";
import {selectLogin} from "../ducks/app/selectors";
function NavBarComponent(props) {

    const currentState = useSelector(selectLogin);
    const dispatch = useDispatch();

    const handleLoginClick = () => {
        dispatch(loginAction());
    };

    const handleLogoutClick = () => {
        dispatch(logoutAction());
    };

    const LoginButton = currentState
        ? <NavLink><Button className="btn-warning" onClick={handleLogoutClick}>Logout</Button></NavLink>
        : <Link to='/login'><Button className="btn-danger" onClick={handleLoginClick}>Login</Button></Link>;

    const RegistrationButton = <Link to='/registration'><Button className="btn-warning">Sign Up</Button></Link>;

    return (
        <Navbar color="light" light>
            <Link to='/feed'>
                <NavbarBrand className="text-decoration-underline">
                    PrivetApp
                </NavbarBrand>
            </Link>
            <Nav className="ml-auto" navbar>
                <NavItem className="text-secondary navbar-text">
                    <Link to={'/feed'}>
                        Feed
                    </Link>
                </NavItem>
                {props.user?.username && (
                    <NavItem className="text-secondary navbar-text">
                        {props.user?.username}
                    </NavItem>
                )}
                {LoginButton}
                {RegistrationButton}
            </Nav>
        </Navbar>
    );
}

NavBarComponent.propTypes = {
    user: PropTypes.shape({username: PropTypes.string})
}

export default NavBarComponent;
